import ExpenseItem from './components/ExpenseItem';
function App(){
    // variablw 
    let expenseDate = new Date(2024,1,1); // it is object
    let expenseTitle ="School fee";
    let expenseAmount = 300;

    // we will not build vairaible array banayenga
    // 12 variable banane padenga
    // instead of variable // => we will use array of object

    let expenses = [
        {
            id: 'e1', // variable
            title: 'School fee',
            amount: 250,
            date: new Date(2023, 1,2) // it is object

        },
        {
            id: 'e2',
            title: 'Books',
            amount: 300,
            date: new Date(2023, 1,3)

        },
        {
            id: 'e3',
            title: 'House rent',
            amount: 350,
            date: new Date(2023, 1,4)

        },
        {
            id: 'e4',
            title: 'Car rent',
            amount: 400,
            date: new Date(2023, 1,5)

        }


    ];

    return (
        <div>
    <ExpenseItem 
        date={expenses[0].date} 
        title={expenses[0].title} 
        amount={expenses[0].amount}
    />
     <ExpenseItem 
        date={expenses[1].date} 
        title={expenses[1].title} 
        amount={expenses[1].amount}
    />
     <ExpenseItem 
        date={expenses[2].date} 
        title={expenses[2].title} 
        amount={expenses[2].amount}
    />
     <ExpenseItem 
        date={expenses[3].date} 
        title={expenses[3].title} 
        amount={expenses[3].amount}
    />
   
   
</div>
   
);
}
export default App;
